import React, { useEffect } from 'react';
import { createRoot } from 'react-dom/client';

function NavBar (props){
    useEffect(() => {
        let selectors = document.querySelectorAll("[id^='"+props.section+"-selector-']");
        let lines = document.querySelectorAll("[id^='"+props.section+"-line-']");
        let currentSelector = 1;

        selectors.forEach( selector => {
            selector.addEventListener("click", () => {
                selector.classList.add('bg-white', 'click-diamond');
                selector.childNodes[0].classList.add('enlarge-diamond');

                let id = selector.id;
                selectors.forEach( otherSelector => {
                    if ( id == otherSelector.id ) return;
                    otherSelector.classList.remove('bg-white', 'click-diamond');
                    otherSelector.childNodes[0].classList.remove('enlarge-diamond');
                })

                let length = selector.id.length;
                let newSelector = parseInt(id[length - 1]);
                let steps = newSelector - currentSelector;
                
                if (steps >= 0){
                    for (let i = currentSelector - 1; i < newSelector - 1; i++){
                        lines[i].classList.add('line-bg-position');
                    }
                }
                else {
                    for (let i = currentSelector - 2; i > newSelector - 2; i--){
                        lines[i].classList.remove('line-bg-position');
                    }
                }

                currentSelector = newSelector;
            })
        })

    }, []);

    function scroll(e) {
        e.preventDefault();
        let key = e.target;
        console.log(key);
        console.log(key.hash);
        let target = document.getElementById(key.hash.slice(1, ));
        let section = parseInt( key.hash[ key.hash.length - 1 ] );
        let scrollTarget = key.parentElement.parentElement.childNodes[1];
        let style = getComputedStyle(target);
        scrollTarget.scrollLeft = (target.clientWidth + parseInt(style.marginRight)) * (section - 1);
    }
    let navbar = [];
    navbar.push( 
        <a key={props.section + "-selector-1"} 
            href={"#" + props.section + "1"} 
            id={props.section + "-selector-1"} 
            className="diamond bg-green bg-white click-diamond flex center-column center-row" 
            title={props.section + " 1"} 
            onClick={scroll} 
        >
            <div className="hidden-diamond enlarge-diamond"></div>        
        </a>
    );

    for (let i = 1; i < parseInt(props.divisions); i++){
        navbar.push( 
            <div key={props.section + "-selector-line-" + (i + 1)} 
                className="line" 
                id={props.section + "-line-" + i}
            >
            </div> 
        );
        navbar.push( 
            <a key={props.section + "-selector-" + (i + 1)} 
                href={"#" + props.section + (i + 1)} 
                id={props.section + "-selector-" + (i + 1)} 
                className="diamond bg-green flex center-column center-row" 
                title={props.section + " " + (i + 1)} 
                onClick={scroll} 
            >
                <div className="hidden-diamond"></div>
            </a>
        );
    }

    return(
        <>
            {navbar}
        </>
    )
}
createRoot(document.getElementById('navbar-projects')).render(<NavBar section="project" divisions="3" />);

createRoot(document.getElementById('navbar-techstack')).render(<NavBar section="techstack" divisions="2" />);

function MainNavBar (){
    useEffect( () => {
        let element = document.getElementById('main-navbar');
        let target = element.parentElement.parentElement;
        
        const initOffset = window.innerHeight;
        let root = document;
        root.addEventListener('scroll', () => {
            if (target.offsetTop > initOffset) {
                target.classList.add('bg-color-purple');
            }
            else if (target.classList.contains('bg-color-purple')) {
                target.classList.remove('bg-color-purple');
            }
        })
    }, [])
    function click(e){
        e.target.classList.add('font-white', 'click-white');

        let navs = document.querySelectorAll('a[class^=transition-navbar]');
        
        navs.forEach( nav => {
            if (e.target.hash == nav.hash) return;
            nav.classList.remove('font-white', 'click-white');
        })
    }
    
    return(
        <>
            <li>
                <a className="transition-navbar" href="#projects" onClick={click} >PROJECTS</a>
            </li>
            <li>
                <a className="transition-navbar" href="#techstack" onClick={click} >TECH STACK</a>
            </li>
            <li>
                <a className="transition-navbar" href="#contact" onClick={click} >CONTACT</a>
            </li>
        </>
    )
}

createRoot(document.getElementById('main-navbar')).render(<MainNavBar />);

