function ToTop(){
    useEffect( () => {
        let element = document.getElementById('to-top');

        let initOffset = window.innerHeight;
        document.addEventListener('scroll', () => {
            if (element.parentElement.parentElement.offsetTop > initOffset) element.classList.add('visible');
            else element.classList.remove('visible');
        })
    }, [])

    function click(){
        let navs = document.querySelectorAll('a[class^=transition-navbar]');

        navs.forEach( (nav) => {
            nav.classList.remove('font-white', 'click-white');
        })
    }

    return(
        <>
            <a href="#home" onClick={click} className="back-to-top-icon"></a>
        </>
    )
}

createRoot(document.getElementById('to-top')).render(<ToTop />);